        <style>
    body {
        font-family: Arial, sans-serif;
        background-color: #f4f4f4;
        margin: 0;
        padding: 3rem 1rem;
        display: grid;
        grid-template-columns: repeat(10, 1fr); /* 10 items per row */
        gap: 1rem;
        justify-content: center;
    }

    .card {
        background: white;
        border-radius: 10px;
        box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
        width: 100%; /* Make it responsive to grid */
        text-align: center;
        transition: transform 0.2s;
        cursor: pointer;
        display: flex;
        align-items: center;
        justify-content: center;
        padding: 0; /* No padding */
        padding-top: 20px;
    }

    .card:hover {
        transform: scale(1.05);
    }

    .card h3 {
        margin: 0 0 1rem;
        font-size: 1.2rem;
    }

    .card a {
        text-decoration: none;
        color: white;
        color: #007bff;
        padding: 1rem 0; /* Padding adjusted for better clickable area */
        border-radius: 5px;
        display: block;
        width: 100%;
        height: 100%;
        text-align: center;
    }

    .clicked {
        background-color: #00e676 !important; /* bright green */
    }

    .review {
        background-color: #9c27b0 !important; /* bright purple */
    }

    .reset-btn {
        position: fixed;
        left: 10px;
        padding: 0.6rem 1.2rem;
        font-size: 1rem;
        background-color: red;
        color: white;
        border: none;
        border-radius: 5px;
        cursor: pointer;
        z-index: 999;
    }

    .reset-btn.top {
        top: 10px;
    }

    .reset-btn.bottom {
        bottom: 10px;
    }
</style>

            const completed = new Set(
                JSON.parse(localStorage.getItem('completed') || '[]')
            );
            const review = new Set(
                JSON.parse(localStorage.getItem('review') || '[]')
            );

            links.forEach((link, i) => {
                const card = document.createElement('div');
                card.className = 'card';
                card.ondblclick = () => handleDoubleClick(i);
                card.innerHTML = `<a href="${link}" onclick="markCompleted(${i}, event)"> ${
                    i + 1
                }</a>`;
                document.body.appendChild(card);
            });

            // On load
            window.onload = () => {
                applyClasses();
            };

            // Mark as completed
            function markCompleted(index, event) {
                event.preventDefault();
                completed.add(index);
                review.delete(index);
                saveStates();
                applyClasses();
                window.open(event.target.href, '_blank');
            }

            // Handle double-click to mark/unmark review
            function handleDoubleClick(index) {
                if (review.has(index)) {
                    review.delete(index);
                } else {
                    review.add(index);
                    completed.delete(index);
                }
                saveStates();
                applyClasses();
            }

            // Reset all highlights
            function resetHighlights() {
                localStorage.removeItem('completed');
                localStorage.removeItem('review');
                completed.clear();
                review.clear();
                applyClasses();
            }

            // Save states to localStorage
            function saveStates() {
                localStorage.setItem(
                    'completed',
                    JSON.stringify([...completed])
                );
                localStorage.setItem('review', JSON.stringify([...review]));
            }

            // Apply class styling
            function applyClasses() {
                document.querySelectorAll('.card').forEach((card, i) => {
                    card.classList.remove('clicked', 'review');
                    if (completed.has(i)) card.classList.add('clicked');
                    if (review.has(i)) card.classList.add('review');
                });
            }
        </script>

        <button onclick="resetHighlights()" class="reset-btn bottom">
            Reset Highlights
        </button>
    </body>
</html>
